import React from 'react';
import { Card, Carousel } from 'react-bootstrap';
import banner1 from '../../../images/banner/banner1.jpg';
import banner2 from '../../../images/banner/banner2.jpg';
import banner3 from '../../../images/banner/banner3.jpg';

const Banner = () => {
    return (
        <div>
            <div class="container">
                <div class="row" className="carousel-inner">
                    <div class="col-12 col-md-6 col-lg-4">
                        <h1>Cox Bazar</h1>
                        <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Itaque doloribus molestias debitis quisquam harum ab praesentium! Consectetur enim culpa voluptates. Eum veniam eveniet obcaecati et nihil earum dicta culpa consequuntur.</p>
                        <button className="btn btn-warning">Booking</button>
                    </div>
                    <div class="col-12 col-md-6 col-lg-8">
                        <Card className="bg-dark text-white">
                            <Card.Img src={banner1} alt="Card image" />
                            <Card.ImgOverlay>
                                <Card.Title>Card title</Card.Title>
                                <Card.Text>
                                    This is a wider card with supporting text below as a natural lead-in to
                                    additional content. This content is a little bit longer.
                                </Card.Text>
                                <Card.Text>Last updated 3 mins ago</Card.Text>
                            </Card.ImgOverlay>
                        </Card>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Banner;
